import React from 'react';
import style from './style.module.css';

export default function AddButton() {
  const sendUserToNew = () => {
    window.location.href = '/new';
  }
  return (
    <div>
      <button onClick={ sendUserToNew }>ADICIONAR</button>
    </div>
  )
}
